import { Component } from "react";
import "../Styles/styles.css";


class ContactForm extends Component{

    constructor(){
        super()
    }

    render(){
        return (<div className="form">
                <form>
                    <input id="input1" type="text" placeholder="New contact's name"/>
                    <input id="input1" type="text" placeholder="New contact's role"/>
                    <input id="input1" type="text" placeholder="New contact's location"/>
                    <input id="input1" type="text" placeholder="New contact's company"/>
                    <input id="input1" type="text" placeholder="New contact's address"/>
                    <input id="input1" type="text" placeholder="New contact's state"/>
                    <input id="input1" type="text" placeholder="New contact's phone"/>
                    <button type="submit" onClick={ () => alert("dgfdg") }>Send</button>
            </form>
        </div>);
    }

}

export default ContactForm;
